import React, { useState } from 'react';
//   url: https://maps.googleapis.com/maps/api/place/textsearch/json?query=[yourquerystring]&key=[YOURAPIKEY]


function getPlace(props) {

  const { isLoaded } = useLoadScript({
    gmapikey: process.env.NEXT_PUBLIC_GOOGLE_MAPS_API_KEY
  });

  if (!isLoaded) <div> Loading... </div>

  const [place, setPlace] = useState("");

  var queryString = props.placeType + "&inputtype=textquery&locationbias=circle%3A2000%" + props.lat + "%2C" + props.lon + "&fields=formatted_address%2Cname%2Crating%2Copening_hours%2Cplace_id%2Ctypes%2Cwebsitegeometry%2Cserves_beer%2Cserves_breakfast%2Cserves_brunch%2Cserves_dinner%2Cserves_lunch%2C";

  const getNewPlace = () => {
    Axios.get("https://maps.googleapis.com/maps/api/place/textsearch/json?query=" + queryString + "&key=" + gmapikey).then(
        (response) => {
            console.log(response)
            setPlace(response.data);
        }
    );
  };

  return (
    <div>
      <header>
              <button onClick={getNewPlace}>
                Get new Place
              </button>
      </header>
    </div>
  );
}

export default getPlace;
